INSERT INTO `tbl_question` (`id`, `exam_id`, `question`, `status`, `marks`, `optionA`, `optionB`, `optionC`, `optionD`, `correct`) VALUES
(1, 1, '<p><strong style=\"font-weight: bold; color: rgb(68, 68, 68); letter-spacing: normal;\">Which of the following is true about Principles of Management?</strong><br></p>', 1, 5, '<ol style=\"margin-bottom: 0px; color: rgb(68, 68, 68); letter-spacing: normal; text-align: left; list-style-type: lower-alpha;\"><li style=\"margin-bottom: 5px;\">The principles of management are in a continuous process of evolution</li></ol>', '<ol style=\"margin-bottom: 0px; color: rgb(68, 68, 68); letter-spacing: normal; text-align: left; list-style-type: lower-alpha;\"><li style=\"margin-bottom: 5px;\">The principles of management have evolved</li></ol>', '<ol style=\"margin-bottom: 0px; color: rgb(68, 68, 68); letter-spacing: normal; text-align: left; list-style-type: lower-alpha;\"><li style=\"margin-bottom: 5px;\">The principles of management have not evolved</li></ol>', '<ol style=\"margin-bottom: 0px; color: rgb(68, 68, 68); letter-spacing: normal; text-align: left; list-style-type: lower-alpha;\"><li style=\"margin-bottom: 5px;\">None of the above</li></ol>', 'A'),
(2, 1, '<p><strong style=\"font-weight: bold; color: rgb(68, 68, 68); letter-spacing: normal;\">The main reason why Principles of Management do not provide readymade solutions for all management problems is that ________.</strong><span style=\"color: rgb(68, 68, 68); letter-spacing: normal;\"></span></p><div><strong style=\"font-weight: bold; color: rgb(68, 68, 68); letter-spacing: normal;\"><br></strong></div><ol style=\"margin-bottom: 0px; color: rgb(68, 68, 68); letter-spacing: normal; list-style-type: lower-alpha;\"></ol>', 1, 5, '<p><span style=\"color: rgb(68, 68, 68); letter-spacing: normal; text-align: left;\">They act as general guidelines for business-related issu</span><br></p>', '<ol style=\"margin-bottom: 0px; color: rgb(68, 68, 68); letter-spacing: normal; text-align: left; list-style-type: lower-alpha;\"><li style=\"margin-bottom: 5px;\">The real business issues are pretty complex</li></ol>', '<ol style=\"margin-bottom: 0px; color: rgb(68, 68, 68); letter-spacing: normal; text-align: left; list-style-type: lower-alpha;\"><li style=\"margin-bottom: 5px;\">The real business issues are very dynamic</li></ol>', '<ol style=\"margin-bottom: 0px; color: rgb(68, 68, 68); letter-spacing: normal; text-align: left; list-style-type: lower-alpha;\"><li style=\"margin-bottom: 5px;\">All of the above</li></ol>', 'D'),
(3, 1, '<p><span style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-serif; font-weight: bolder; color: rgb(60, 72, 82); font-size: 16px; letter-spacing: normal;\">&nbsp;Pure science principles are rigid, whereas management principles are relatively</span><br></p>', 1, 5, '<ol style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-seri', '<ol style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-seri', '<ol style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-seri', '<ol style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-seri', 'C'),
(4, 1, '<p><span style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-serif; font-weight: bolder; color: rgb(60, 72, 82); font-size: 16px; letter-spacing: normal;\">Who is referred to be the Father of Scientific Management?</span><br></p>', 1, 5, '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', 'C'),
(5, 1, '<p><span style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-serif; font-weight: bolder; color: rgb(60, 72, 82); font-size: 16px; letter-spacing: normal;\">&nbsp;When their manager is out from the office, a worker tells how his co-workers leave business documents on the reception desk and personal stuff in the conference room. What impact would this have on a companys operations?</span><br></p>', 1, 5, '<p style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6rem; line-height: 24', '<p style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6rem; line-height: 24', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', 'C'),
(6, 1, '<p><span style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-serif; font-weight: bolder; color: rgb(60, 72, 82); font-size: 16px; letter-spacing: normal;\">According to Henri Fayol, which of the following is true of discipline?&nbsp;</span><br></p>', 1, 5, '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6rem; line-height: 24', '<p style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6rem; line-height: 24', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', 'D'),
(7, 1, '<p><span style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-serif; font-weight: bolder; color: rgb(60, 72, 82); font-size: 16px; letter-spacing: normal;\">&nbsp;Formulation of MOST is done by:</span><br></p>', 1, 5, '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', 'B'),
(8, 1, '<p><span style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-serif; font-weight: bolder; color: rgb(60, 72, 82); font-size: 16px; letter-spacing: normal;\">What are functional managers responsible for?</span><br></p>', 1, 5, '<p style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6rem; line-height: 24', '<p style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6rem; line-height: 24', '<p style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6rem; line-height: 24', '<p style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6rem; line-height: 24', 'A'),
(9, 1, '<span style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-serif; font-weight: bolder; color: rgb(60, 72, 82); font-size: 16px; letter-spacing: normal;\">The degree to which power is concentrated or dispersed depends on the context and circumstances of each business. The principles provide the manager considerable leeway to adapt to changing circumstances. Which of the management principles is emphasised above?</span>', 1, 5, '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<ol style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-seri', 'B'),
(10, 1, '<p><span style=\"text-rendering: optimizelegibility; word-break: break-word; outline: none; margin: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-family: AvertaStd, -apple-system, BlinkMacSystemFont, sans-serif; font-weight: bolder; color: rgb(60, 72, 82); font-size: 16px; letter-spacing: normal;\">Management Principles improve management efficiency by allowing managers to delegate regular decision-making to their subordinates and deal with unexpected events that demand their knowledge by following the Delegation Principles. What does the aforementioned scenario mean in terms of management?</span><br></p>', 1, 5, '<p style=\"text-align: justify; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', '<p style=\"text-align: left; text-rendering: optimizelegibility; word-break: break-word; outline: none; margin-top: 0px; margin-right: 0px; margin-left: 0px; -webkit-font-smoothing: antialiased; overscroll-behavior: none; font-weight: 400; font-size: 1.6re', 'B'),
